/* iFrame Extension for Delta Lloyd
 *
 *  @author: Caleb Jaquith, Tealium Inc.
 *
 *  @purpose: manually trigger utag.link() inside iframe applications after
 *            the wrapper has completely loaded.  This ensures proper analytics
 *            tracking, as per
 *
 *  @scope: DOM Ready
 *
 */

// configuration settings
var config = {
  'wrapperOrigin'    : 'http://tealium-solutions.dev', // can't be automatic
  'iframeDivId'      : 'applicatie', // might be good to support an array
  'messageObjectOverrides' : {
    'event_type' : 'iframe_trigger'
  }
};
// end config, shouldn't need to change anything else.

// to correct for extension scope if needed
var b = b ||utag.data || {};

var frameCheck = document.getElementById(config.iframeDivId);

// make sure to only fire on pages that have a relevant iframe app
if (frameCheck &amp;&amp; frameCheck.contentWindow) {
  var appFrame = frameCheck.contentWindow;
  // get the domain of the iframe
  var a = getLocation(frameCheck.src);
  var iframeOrigin = a.origin;
  // set up the event to fire when the page loads
  window.addEventListener(&quot;load&quot;, function(event) {
    logger(&quot;All resources finished loading!&quot;);
    sendMessage(event);
  });
}

// only write to console in Dev / QA environments
function logger(message) {
  if (!/\/prod\//.test(utag.cfg.path)) {
    console.info(&quot;TEALIUM IFRAME EXTENSION ::&quot;, message);
  }
}

// add/overwrite properties in object a with those from object b
function mergeObjects(a, b){
  for (var key in b) {
      a[key] = b[key];
    }
    return a;
}

function getLocation(href) {
    var location = document.createElement(&quot;a&quot;);
    location.href = href;
    // IE doesn't populate all link properties when setting .href with
    // a relative URL, but .href will return an absolute URL which then can
    // be used on itself to populate these additional fields.
    if (location.host == &quot;&quot;) {
      location.href = location.href;
    }
    return location;
};

function sendMessage(e) {
  // stop default browser behavior if needed (just in case)
  if (e &amp;&amp; e.preventDefault &amp;&amp; typeof e.preventDefault == 'function') {
    e.preventDefault();
  }

  // get the config settings for the object
  var messageObject = config.messageObjectOverrides;
  // send the message
  appFrame.postMessage(messageObject, iframeOrigin);
  logger(&quot;Sent message &quot; + messageObject);
}

function receiveMessage(e) {
  // verify the domain (not sure if it's needed)
  if (e.origin !== config.wrapperOrigin) {
    return;
  }
  logger(&quot;Message listener triggered!&quot;);
  // merge the received override data with the utag.data on the page
  var messageObject = mergeObjects(b, e.data);
  // fire utag.link with the data
  utag.link(messageObject);
}

// set up the sender in the wrapper
if (b.iframe_or_wrapper == 'wrapper') {
  var btn = document.getElementById('send');
  btn.addEventListener('click', sendMessage);
  logger(&quot;Added sender to button.&quot;);
}

// set up the listener in the iframe
if (b.iframe_or_wrapper == 'iframe') {
  window.addEventListener('message', receiveMessage);
  logger(&quot;Added listener to iframe.&quot;);
}

