/* iFrame Extension for Delta Lloyd (2/4)

 *  @author: Caleb Jaquith, Tealium Inc.
 *
 *  @purpose: manually trigger a utag.view() inside iframe applications after
 *            the wrapper has completely loaded.  This ensures proper analytics
 *            tracking.
 *
 *  @scope: Pre Loader
 *
 */

// configuration settings should be set in a separate, Pre Loader scoped extension
var config = utag_data.ext.iframeWrapperConfig;

// don't do anything if the config is missing
if (config) {
  function getParameterByName(name, url) {
    if (!url) {
      url = window.location.href;
    }
    name = name.replace(/[\[\]]/g, &quot;\\$&amp;&quot;);
    var regex = new RegExp(&quot;[?&amp;]&quot; + name + &quot;(=([^&amp;#]*)|&amp;|#|$)&quot;),
      results = regex.exec(url);
    if (!results) return null;
    if (!results[2]) return '';
    return decodeURIComponent(results[2].replace(/\+/g, &quot; &quot;));
  }

  var queryStringCheck = getParameterByName(config.iframeQueryString);

  // don't fire the default utag.view() for embedded iframes (recognizable by the queryString)
  if (config.iframeProperty == config.iframeValue &amp;&amp; queryStringCheck !== null) {
    window.utag_cfg_ovrd = {noview:true};
  }
}

