function addUsabillaCallback () {

  console.info(&quot;usabilla_live typeof is &quot; + typeof usabilla_live);

  // try again if the required object is missing
  if (typeof usabilla_live == &quot;undefined&quot;) {
    console.info(&quot;Try again later.&quot;);
    setTimeout(addUsabillaCallback, 150);
    return false;
  }

  console.info(&quot;Adding usabilla_live callback&quot;);
  usabilla_live(&quot;setEventCallback&quot;, function(category, action, label, value) {
    debugger;
    if (action != &quot;Campaign:Open&quot;) {
      return;
    }

    window.addEventListener(&quot;message&quot;, function(event) {
      // Listen to messages from the Usabilla Cloudfront domain
      if (!/d6tizftlrpuof\.cloudfront\.net/.test(event.origin)) {
        return;
      }

      try {
        var data = JSON.parse(event.data);
        // On the final page

        if (data.type === &quot;pageSwitch&quot; &amp;&amp; data.end) {
          for (var key in data.data) {
            utag.link({
              &quot;event_type&quot;: &quot;usabilla&quot;,
              &quot;event_category&quot;: label,
              &quot;event_action&quot;: key,
              &quot;event_label&quot;: data.data[key]
            });
          }
        }
      } catch (e) {
        // Ignore errors, usually JSON decode problems
      }
    });
  });
}

addUsabillaCallback();
